trailingComments.value:
*
 * 根据书籍 ID 打开客户端听书详情页（可指定章节，默认为第一章）
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @param {Object} params - 调用客户端桥所需要的参数
 * @param {string} params.bid - 书籍id，必选参数
 * @param {string} params.cId - 章节序号，可选参数，默认''
 *
 * @returns {Promise<*>}   成功1，失败0
 *
 * @example
 * libSQ.exec('open-audio-book', { params: {
 *   bookId: '7251227',
 * } }).then((info) => {
 *   console.log(`[open-audio-book][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[open-audio-book][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

